import { Label } from "@mui/icons-material";
import { Stack, TextField } from "@mui/material";
import { Formik } from "formik";

// Create the struct of the formData
interface myFormData {
  email: string;
  password: string;
}

// Login method
const login = (formData: Object) => {
  console.log(formData);
};

const Login = () => {
  let initFormValues: myFormData = { email: "", password: "" };

  return (
    <Stack alignItems={"center"} justifyContent={"center"} mt={20}>
      <Formik
        initialValues={initFormValues}
        onSubmit={(values) => login(values)}
      >
        <Stack sx={{ width: 500 }}>
          <Label />
          <TextField variant="outlined" label="Email" id="outlined-basic" />

          <TextField id="outlined-basic" label="Outlined" variant="outlined" />
          <TextField id="filled-basic" label="Filled" variant="filled" />
          <TextField id="standard-basic" label="Standard" variant="standard" />
          
        </Stack>
      </Formik>
    </Stack>
  );
};

export default Login;
